      SELECT DISTINCT 91 / 53 AS col0 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet), tab2 (FORMAT parquet) AS cor1, tab1 (FORMAT parquet) AS cor2;
  - name: tab1
  - name: tab2

outputs:
  - name: q2616.out
    data: |
      1
